import styled from "styled-components"

export  const Button = styled.button`
color: palevioletred;
font-size: 1em;
margin: 1em;
padding: 0.25em 1em;
border: 2px solid palevioletred;
border-radius: 3px;

`


export const Input = styled.input`
background-color:purple;
height:20px;
width:50%;
padding:1em;
border:2px solid black;
`
